/**
 * @summary Transforms the provided input record into zero or more output records or errors.

 * Input records are available in JavaScript code as JSON objects. 

 * @param input an object that contains the input record as a JSON.   e.g. to access a field called 'total' from the input record, use input.total.
 * @param emitter an object that can be used to emit zero or more records (using the emitter.emit() method) or errors (using the emitter.emitError() method) 
 * @param context an object that provides access to:
 *            1. CDAP Metrics - context.getMetrics().count('output', 1);
 *            2. CDAP Logs - context.getLogger().debug('Received a record');
 *            3. Lookups - context.getLookup('blacklist').lookup(input.id); or
 *            4. Runtime Arguments - context.getArguments().get('priceThreshold') 
 */ 
function transform(input, emitter, context) { // Added emitter and context
    // Create a new nested record containing only the fields needed for collection
    var record_to_collect = {
        amount: input.amount, // From OdsCashInOut
        transactioneffectivedate: input.transactioneffectivedate,
        id: input.id // From OdsCashAllocation
    };

    // Emit the scheduleid and the new nested record
    emitter.emit({ // Changed from 'return' to 'emitter.emit'
        scheduleid: input.scheduleid,
        record_for_collection: record_to_collect
    });
}

/**
 * @summary Transforms the provided input record into zero or more output records or errors.

 * Input records are available in JavaScript code as JSON objects. 

 * @param input an object that contains the input record as a JSON.   e.g. to access a field called 'total' from the input record, use input.total.
 * @param emitter an object that can be used to emit zero or more records (using the emitter.emit() method) or errors (using the emitter.emitError() method) 
 * @param context an object that provides access to:
 *            1. CDAP Metrics - context.getMetrics().count('output', 1);
 *            2. CDAP Logs - context.getLogger().debug('Received a record');
 *            3. Lookups - context.getLookup('blacklist').lookup(input.id); or
 *            4. Runtime Arguments - context.getArguments().get('priceThreshold') 
 */ 
function transform(input, emitter, context) { // Added emitter and context
    var scheduleId = input.scheduleid;
    var collectedRecords = input.collected_records;

    if (!collectedRecords || collectedRecords.length === 0) {
        // No emitter.emit() call, so record is filtered out
        return;
    }

    // Sort function for the collected records array
    // Sort by transactioneffectivedate DESC, then by id DESC
    collectedRecords.sort(function(a, b) {
        var dateA = a.transactioneffectivedate != null ? a.transactioneffectivedate : -Infinity;
        var dateB = b.transactioneffectivedate != null ? b.transactioneffectivedate : -Infinity;

        if (dateA < dateB) return 1;
        if (dateA > dateB) return -1;

        var idA = a.id != null ? a.id : -Infinity;
        var idB = b.id != null ? b.id : -Infinity;

        if (idA < idB) return 1;
        if (idA > idB) return -1;

        return 0;
    });

    // The first record in the sorted list is now the one with rn=1
    var firstRecord = collectedRecords[0];

    // Extract the required fields from the first record
    var last_payment_amount = firstRecord.amount;
    var last_payment_date = firstRecord.transactioneffectivedate;

    // Emit the new record
    emitter.emit({ // Changed from 'return' to 'emitter.emit'
        scheduleid: scheduleId,
        last_payment_amount: last_payment_amount,
        last_payment_date: last_payment_date
    });
}

/**
 * @summary Transforms the provided input record into zero or more output records or errors.

 * Input records are available in JavaScript code as JSON objects. 

 * @param input an object that contains the input record as a JSON.   e.g. to access a field called 'total' from the input record, use input.total.
 * @param emitter an object that can be used to emit zero or more records (using the emitter.emit() method) or errors (using the emitter.emitError() method) 
 * @param context an object that provides access to:
 *            1. CDAP Metrics - context.getMetrics().count('output', 1);
 *            2. CDAP Logs - context.getLogger().debug('Received a record');
 *            3. Lookups - context.getLookup('blacklist').lookup(input.id); or
 *            4. Runtime Arguments - context.getArguments().get('priceThreshold') 
 */ 
// Function to transform each input record
function transform(input, emitter, context) { // Added emitter and context
    var unpaidamountagr = input.unpaidamountagr
    var firstfellduedate_days = input.firstfellduedate != null ? input.firstfellduedate : null;

    // Apply WHERE clause filters
    if (unpaidamountagr <= 0.0 || firstfellduedate_days == null) {
        return;
    }

    // Get current date (UTC midnight for consistency with SQL CURRENT_DATE)
    var current_date_ms = new Date().setUTCHours(0, 0, 0, 0);

    // Convert firstfellduedate (days since epoch) to milliseconds for Date object
    var firstFellDate_ms = firstfellduedate_days * 24 * 60 * 60 * 1000;
    var firstFellDate = new Date(firstFellDate_ms);
    firstFellDate.setUTCHours(0, 0, 0, 0);

    // Calculate difference in days
    var days_past_due_calculated = Math.floor((current_date_ms - firstFellDate.getTime()) / (24 * 60 * 60 * 1000));

    // Create flags for each aging bucket condition (1 for true, 0 for false)
    var is_31_60_days = 0;
    if (days_past_due_calculated >= 31 && days_past_due_calculated <= 60) {
        is_31_60_days = 1;
    }

    var is_61_90_days = 0;
    if (days_past_due_calculated >= 61 && days_past_due_calculated <= 90) {
        is_61_90_days = 1;
    }

    var is_gt_90_days = 0;
    if (days_past_due_calculated > 90) {
        is_gt_90_days = 1;
    }

    // Emit the new record
    emitter.emit({ // Changed from 'return' to 'emitter.emit'
        scheduleid: input.scheduleid,
        is_31_60_days: is_31_60_days,
        is_61_90_days: is_61_90_days,
        is_gt_90_days: is_gt_90_days
    });
}

